import React, { Component } from 'react';
import Dropdown from 'react-bootstrap/Dropdown';


class NavDrop extends Component {
  render() {
    return (
      <Dropdown>
        <Dropdown.Toggle variant="link" className="navLinks" id="dropdown-custom-components">
          Notes
        </Dropdown.Toggle>

        <Dropdown.Menu>
          <Dropdown.Item href="https://en.wikipedia.org/wiki/Sandalwood" target="blank">Sandalwood</Dropdown.Item>
          <Dropdown.Item href="https://en.wikipedia.org/wiki/Vanilla" target="blank">Vanilla</Dropdown.Item>
          <Dropdown.Item href="https://en.wikipedia.org/wiki/Amber" target="blank">Amber</Dropdown.Item>
        </Dropdown.Menu>
      </Dropdown>
    )
  }
}

export default NavDrop;
